import React from 'react';
import createRoot from 'react-dom';
import { BrowserRouter } from 'react-router-dom';

import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import Category from './post/PageCategory';
import Page from './post/PagePost';

//index.html root 아이디에 App 컴포넌트를 렌더링합니다.
const rootContainer = document.getElementById('root');
if (rootContainer) {
  createRoot.render(
    <React.StrictMode>
      <BrowserRouter>
        <App />

      </BrowserRouter>
    </React.StrictMode>,
    rootContainer
  );
} else {
  console.error('Container element with id "root" not found.');
}

// index.html category 아아디에 Category 추가 (컴포넌트를 렌더링)
const categoryContainer = document.getElementById('Box2');
if (categoryContainer) {
  createRoot.render(
    <React.StrictMode>
      <BrowserRouter>
        <Page/>
        <Category/>
      </BrowserRouter>
    </React.StrictMode>,
    categoryContainer
  );
} 

reportWebVitals();
